import React, { useState } from 'react';
import logo from "../assets/logo.png";
import { Divider } from 'primereact/divider';
import { TabView, TabPanel } from 'primereact/tabview';
import { Button } from 'primereact/button';
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import FavoriteIcon from '@mui/icons-material/Favorite';


const categories = [
  { id: 1, name: 'SUELTOS', subcategories: ["Maiz", "Harina"] },
  { id: 2, name: 'ESPECIALES', subcategories: ["Subcategory1", "Subcategory2"] },
  // Add more categories with their subcategories as needed
];

function Menu() {
  const [activeIndex, setActiveIndex] = useState(0);
  const [selectedCategory, setSelectedCategory] = useState(categories[0]); // Start with the first category

  const handleCategorySelect = (category) => {
    setSelectedCategory(category);
  };

  return (
    <div style={{ backgroundColor: "var(--background" }}>
      <div>
        <img src={logo} alt="Logo" className="w-8rem h-auto p-4" />
        <div className='overflow-x-auto overflow-y-hidden white-space-nowrap py-2 px-3 mx-1' style={{ WebkitOverflowScrolling: 'touch', scrollbarWidth: 'none', msOverflowStyle: 'none' }}>
          {categories.map((category) => (
            <Button
              key={category.id}
              severity={selectedCategory.id === category.id ? 'danger' : 'secondary'}
              rounded
              className={selectedCategory.id === category.id ? 'mr-2' : 'bg-gray-400 opacity-30 mr-2'}
              onClick={() => handleCategorySelect(category)}
            >
              <h5 className="font-normal m-2 center" style={{ color: 'var(--white)' }}>{category.name}</h5>
            </Button>
          ))}
        </div>
        <div className="mx-4 my-2">
          <Divider className="h-2" />
        </div>
        <div className="mx-5 my-4">
          <TabView className='' activeIndex={activeIndex} onTabChange={(e) => setActiveIndex(e.index)}  panelContainerClassName="" panelContainerStyle="">
              <TabPanel key={index} header={subcategory} className='pr-5' style={{ backgroundColor: "var(--background" }}>
                <p className="m-0">
                <div>
                <Card key={index} sx={{ borderRadius: "1rem", backgroundColor: "var(--black)", position: "relative", maxWidth: "24rem", maxHeight: "12rem", display: "flex", marginX: "1rem" }} elevation={5}>
                  <div style={{ width: "50%", position: "relative", overflow: "hidden", display: "flex", flexDirection: "column", }}>
                    <div style={{ height: "100%", flex: 1, backgroundColor: "var(--red)", justifyContent: "center", alignItems: "center", display: "flex", paddingLeft: "1rem", paddingRight: "1rem" }}>
                      <Grid container justifyContent="center" alignItems="center" spacing={0}>
                        <Grid item xs={12}>
                          <h3 className="font-extrabold" style={{ color: 'var(--white)', fontSize: '3rem' }}>3 x 2</h3>
                        </Grid>
                        <Grid item xs={12}>
                          <h3 className="font-bold" style={{ color: 'var(--black)' }}>{sale.title}</h3>
                        </Grid>
                        <Grid item xs={12}>
                          <h5 className="font-medium" style={{ color: 'var(--black)' }}> De {sale.oldPrice} a</h5>
                        </Grid>
                        <Grid item xs={12}>
                          <h2 className="font-extrabold" style={{ color: 'var(--black)', fontSize: '3rem' }}> {sale.newPrice}</h2>
                        </Grid>
                      </Grid>
                    </div>
                  </div>
                  <div style={{ width: "50%", height: "100%", position: "relative" }}>
                    <img src={sale.image} alt={sale.title} style={{ width: "100%", height: "100%", objectFit: "cover" }} />
                    <div style={{ position: "absolute", bottom: "0", right: "0", paddingBottom: "1rem", paddingRight: "0.2rem" }}>
                      <FavoriteIcon style={{ color: 'var(--opaque)', fontSize: "3rem" }}></FavoriteIcon>
                    </div>
                  </div>
                </Card>
              </div>
            ))}
                </p>
              </TabPanel>
            ))}
          </TabView>
        </div>
      </div>
    </div>
  );
}

export default Menu;
